import './App.scss';
import Home from "./pages/Home/Home";
import Nav from './components/Nav/Nav';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';

function App() {
  return (
    <div className='app'>
      <Router>
        <Routes>
          <Route path="/" element={<Home />} />
        </Routes>
          <div className='nav'>
            <Nav />
          </div>
      </Router>
    </div>
  );
}

export default App;
